import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/login">
          <h1>Login</h1>
        </Route>
        <Route path="/">
          <h1>Neewsfeed</h1>
        </Route>
        <Route path="/:userId">
          <h1>User page</h1>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
